def spider(q,b,brute):
	global stop_run
	while not q.empty():
		x=q.get_nowait()
		url=x[0]
		ip=x[1]
		if stop_run:
			break
		try:
			r=requests.get(url,timeout=3,verify=False,proxies=proxies)
			html=r.content
			soup=BeautifulSoup(html,'html.parser')
			a=soup.find_all('title')
			title=a[0].string.strip()
			# a=soup.title.text
			if brute:
				if a:
					b.put(url)
				elif r.status_code!=404:
					b.put(url)
				Backup(b,url,title,ip)
			else:
				if a:
					result(url,title,ip,'')
					# result(url,a,ip,'')
				elif r.status_code!=404:
					result(url,'',ip,'')
				else:
				 	pass
		except Exception as e:
			pass
	if int(comboxlist2.get()) >= 500:
		time.sleep(10)
	if int(comboxlist2.get()) < 500:
		time.sleep(5)
	Label_4.config(text="扫描任务已结束") 

def Backup(b,url,title,ip):
	f=open('dir.txt','r')
	dirs=f.readlines()
	while not b.empty():
		u=b.get_nowait()
		for path in dirs:
			path=path.strip('\n')
			t=u+path
			try:
				r=requests.get(t,timeout=3,verify=False,proxies=proxies)
				if r.status_code==200 and 'html' not in r.text:
					result(url,title,ip,t)
				else:
					result(url,title,ip,'')
					break
			except Exception as e:
				result(url,title,ip,'')
