def hash():
	url=e1.get()
	r = requests.get(url,proxies=proxies)
	favicon = base64.encodebytes(r.content)
	hash = mmh3.hash(favicon)
	result='icon_hash="{}"'.format(hash)
	text.insert("end",result+'\n')

